import Header from './components/Header';
import SideBar from './components/SideBar';
import AddClass from './components/AddClass';
import AllClasses from './components/AllClasses';
import TimeTable from './components/TimeTable';
import {BrowserRouter as Router,Routes, Route} from "react-router-dom"
import UpdateClass from './components/UpdateClass';
import {ProSidebarProvider,Menu,MenuItem,SubMenu,SidebarHeader,SidebarContent,SidebarFooter} from "react-pro-sidebar";
import {FaGem, FaHeart} from 'react-icons/fa'





function App() {
  return (
  <Router>
    <div>

      <Header/>
      <SideBar/>
      <Routes>
      <Route path="/add" element={<AddClass/>}/>
      <Route path="/" element={<AllClasses/>}/>
      <Route path="/table" element={<TimeTable/>}/>


      <Route path="/get/:id" element={<UpdateClass/>}/>
      <Route path="/update/:id" element={<UpdateClass/>}/>
      </Routes>


    </div>
    </Router>
  ); 
}

export default App;
